/****** Object:  UserDefinedFunction [dbo].[FN_MASK_TELNO]    Script Date: 2021-09-02 오전 10:02:33 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[FN_MASK_TELNO]') AND type in (N'FN', N'IF', N'TF', N'FS', N'FT'))
BEGIN
execute dbo.sp_executesql @statement = N'-- 함수생성
CREATE FUNCTION [dbo].[FN_MASK_TELNO](@STR VARCHAR(50))
RETURNS VARCHAR(50)
AS
     BEGIN
         DECLARE @RTNVALUE VARCHAR(50), @STRLEN INT, @POS INT, @VSTR VARCHAR(50);
         SET @VSTR = REPLACE(REPLACE(@STR, '' '', ''''), ''-'', '''');
         SET @STRLEN = LEN(@VSTR);
         IF @STRLEN < 7
             BEGIN
                 SET @RTNVALUE = @VSTR;
         END;
             ELSE
             IF @STRLEN = 7
                 BEGIN
                     SET @RTNVALUE = ''***-'' + RIGHT(@VSTR, 4);
             END;
                 ELSE
                 IF @STRLEN = 8
                     BEGIN
                         SET @RTNVALUE = ''****-'' + RIGHT(@VSTR, 4);
                 END;
                     ELSE
                     IF @STRLEN = 9
                         BEGIN
                             SET @RTNVALUE = ''02-****-'' + RIGHT(@VSTR, 4);
                     END;
                         ELSE
                         IF @STRLEN = 10
                             BEGIN
                                 IF LEFT(@VSTR, 2) = ''02''
                                     BEGIN
                                         SET @RTNVALUE = LEFT(@VSTR, 2) + ''-****-'' + RIGHT(@VSTR, 4);
                                 END;
                                     ELSE
                                     BEGIN
                                         SET @RTNVALUE = LEFT(@VSTR, 3) + ''-***-'' + RIGHT(@VSTR, 4);
                                 END;
                         END;
                             ELSE
                             IF @STRLEN = 11
                                 BEGIN
                                     SET @RTNVALUE = LEFT(@VSTR, 3) + ''-****-'' + RIGHT(@VSTR, 4);
                             END;
         RETURN @RTNVALUE;
     END;' 
END
GO
