                         ELSE
                         IF @STRLEN = 10
                             BEGIN
                                 IF LEFT(@VSTR, 2) = ''02''
                                     BEGIN
                                         SET @RTNVALUE = LEFT(@VSTR, 2) + ''-'' + RIGHT(LEFT(@VSTR, 7), 4) + ''-'' + RIGHT(@VSTR, 4);
                                 END;
                                     ELSE
                                     BEGIN
                                         SET @RTNVALUE = LEFT(@VSTR, 3) + ''-'' + RIGHT(LEFT(@VSTR, 7), 4) + ''-'' + RIGHT(@VSTR, 4);
                                 END;
